import React from 'react';
import PropTypes from 'prop-types';

class Entry extends React.Component {
    render() {
        const {
            title,
            subtitle,
            image,
            link,
            content,
            languages,
        } = this.props;
        return (
            <div>
               {title}
               {subtitle}
               <img src={image} />
               {link}
               {content}
               {languages}
            </div>
        );
    }
}



export default Entry;
